// }


const Main = (props) => {
    return (
    <DateHeader>
      <DaysBox>
        <Sun>일</Sun>
        <Week>월</Week>
        <Week>화</Week>
        <Week>수</Week>
        <Week>목</Week>
        <Week>금</Week>
        <Sat>토</Sat>
      </DaysBox>
      <DateBox>
          <EachDate>
              {EachDate}
          </EachDate>
      </DateBox>
    </DateHeader>
  );
};

const DateHeader = styled.div`



`;
const DaysBox = styled.div`
display: flex;
flex-direction: row;
justify-content: space-between;
background-color: white;
align-item: center;
text-align: center;
margin 0 auto;
width:100%;
`;
const DateBox = styled.div``;
const EachDate = styled.div``;

const Sun = styled.div`
  background-color: white;
  color: tomato;
  margin: 10px;
  width: 14%;
`;

const Week = styled.div`
  background-color: white;
  color: black;
  margin: 10px;
  width: 14%;
`;

const Sat = styled.div`
  background-color: white;
  color: blue;
  margin: 10px;
  width: 14%;
`;

export default Main;
